(function(n){n.addEventListener("click",function(n){if(n.target){let i=n.target.closestAttribute("data-close");if(i!==null){let n=i.closestClass(i.dataset.close);if(n!==undefined){var t=confirm("This action cannot be undone. Are you sure?");if(t){n.parentNode.removeChild(n);let t=new CustomEvent(`${i.dataset.close}.close`,{detail:i});n.dispatchEvent(t)}}}else{let t=n.target.closestAttribute("data-dismiss");if(t!==null){let n=t.closestClass(i.dataset.dismiss);n!==undefined&&n.parentNode.removeChild(n)}}}})})(document,window,0);